$(document).ready(()=>{$(".progress-bar").css("width",model.xp/model.xpNeeded*100+"%");let n=new Vue({el:"#tabContent",data:{historyPageCount:1,myQuizzesPageCount:1,badgesPageCount:1},mounted:function(){this.historyCallback(1);this.myQuizzesCallback(1)},methods:{historyCallback:function(n){let t=this;axios.get(util.apiUrl("/api/getQuizList",{page:n,size:global.quizCardAmount,type:"history",username:model.userName})).then(function(n){let i=t.renderList("#historyList",n.data);i>1&&(t.historyPageCount=i)})},myQuizzesCallback:function(n){let t=this;axios.get(util.apiUrl("/api/getQuizList",{page:n,size:global.quizCardAmount,type:"quizzesBy",username:model.userName})).then(function(n){let i=t.renderList("#myQuizzesList",n.data);i>1&&(t.myQuizzesPageCount=i)})},badgesCallback:function(){},renderList:function(n,t){$(n).empty();let i=$(n).html(t);return parseInt($(i.find(".totalPages")[0]).attr("amount"))}}})});